import { Navbar, Container, Nav } from "react-bootstrap"
const NavigationBar = () => {
    return (
        <Navbar>
            <container>
                <Nav>
                <Navbar.Brand href="#home">Brand link</Navbar.Brand>
                </Nav>
            </container>
        </Navbar>
    )
}

export default NavigationBar
